import React from 'react'
import styles from './LatestPostsHeader.module.css'
class LatestPostsHeader extends React.Component {
  constructor(props) {
    super(props)
    this.state = 0
  }
  render() {
    return (
      <div className={styles.header}>
        <h1>Latest Posts</h1>
      </div>
    )
  }
}

export default LatestPostsHeader
